(329, 1, 'Vous pouvez vous désinscrire à tout moment. Vous trouverez pour cela nos informations de contact dans les conditions d\'utilisation du site.', '2022-11-21 10:48:58'),
(329, 2, 'Sie können Ihr Einverständnis jederzeit widerrufen. Unsere Kontaktinformationen finden Sie u. a. in der Datenschutzerklärung.', '2022-11-21 10:48:58'),
(329, 3, 'U kunt op elk gewenst moment weer uitschrijven. Hiervoor kunt u de contactgegevens gebruiken uit de algemene voorwaarden.', '2022-11-21 10:48:58'),
(329, 4, 'Puoi annullare l\'iscrizione in ogni momenti. A questo scopo, cerca le info di contatto nelle note legali.', '2022-11-21 10:48:58'),
(329, 5, 'Puede darse de baja en cualquier momento. Para ello, consulte nuestra información de contacto en el aviso legal.', '2022-11-21 10:48:58'),
(329, 6, 'You may unsubscribe at any moment. For that purpose, please find our contact info in the legal notice.', '2022-11-21 10:48:58'),
(329, 7, 'Du kan framelde dig når som helst. Vores kontaktoplysninger til framelding er anført i handelsbetingelserne.', '2022-11-21 10:48:58'),
(329, 8, 'Du kan melde deg av når som helst. Av den grunn, vennligst finn vår kontaktinformasjon i \njuridiske merknader.', '2022-11-21 10:48:58'),
(329, 9, 'Du kan melde deg av når som helst. Av den grunn, vennligst finn vår kontaktinformasjon i \njuridiske merknader.', '2022-11-21 10:48:58'),
(329, 10, 'Du kan avbryta prenumerationen när som helst. För detta ändamål, vänligen hitta vår kontaktinformation i det rättsliga meddelandet.', '2022-11-21 10:48:58'),
(329, 11, 'Odběr novinek můžete kdykoliv zrušit. Pokud to chcete udělat, naše kontaktní informace naleznete v právním oznámení.', '2022-11-21 10:48:58'),
(329, 12, 'Możesz zrezygnować w każdej chwili. W tym celu należy odnaleźć szczegóły w naszej informacji prawnej.', '2022-11-21 10:48:58'),
(329, 13, 'Bármikor leiratkozhatsz. Ehhez keresd meg az elérhetőségi adatainkat a jogi nyilatkozatban.', '2022-11-21 10:48:58'),
(329, 14, 'Te poti dezabona in orice moment. Pentru aceasta te rugam sa folosesti informatiile noastre de contact din nota legala.', '2022-11-21 10:48:58'),
(329, 15, 'Možete se odjaviti u bilo kojem trenutku. U tu svrhu, molimo pronađite naše kontakt informacije u pravnim obavijestima.', '2022-11-21 10:48:58'),
(329, 16, 'Можете да се отпишете във всеки момент. За целта моля намерете информацията за контакт с нас в правните условия.', '2022-11-21 10:48:58'),
