INSERT INTO `ps_order_message_lang` (`id_order_message`, `id_lang`, `name`, `message`) VALUES
(1, 1, 'Retard', 'Bonjour,\n\nMalheureusement, un article que vous avez commandé est actuellement en rupture de stock. Pour cette raison, il est possible que la livraison de votre commande soit légèrement retardée.\nNous vous prions de bien vouloir accepter nos excuses. Nous faisons tout notre possible pour remédier à cette situation.\n\nCordialement,'),
(1, 2, 'Lieferung', 'Leider sind ein oder mehrere Artikel Ihrer Bestellung derzeit nicht auf Lager. Dies kann zu einer leichten Verzögerung bei Auslieferung führen. Wir entschuldigen uns und versichern Ihnen, dass Sie Ihre Bestellung schnellstmöglich erhalten.'),
(1, 3, 'Vertraging', 'Hallo, Een van de door u bestelde artikelen is momenteel niet op voorraad. Hierdoor kan de levertijd iets uitlopen. Wij bieden u onze excuses aan en doen er alles aan om u zo snel mogelijk te leveren. Met vriendelijke groet,'),
(1, 4, 'Retard', 'Buongiorno,\n\npurtroppo un articolo che hai ordinato è momentaneamente esaurito. Potrebbe pertanto verificarsi un leggero ritardo nella consegna.\nScusandoci per l\'inconveniente, ti assicuriamo che stiamo facendo del nostro meglio per risolverlo.\n\nCordiali saluti,'),
(1, 5, 'Retard', 'Hola:\n\nDesafortunadamente, un producto de su pedido está fuera de stock en este momento. Esto puede originar un pequeño retraso en el envío. Trabajaremos lo más rápido posible para solucionarlo. Por favor, acepte nuestras disculpas.\n\nSaludos'),
(1, 6, 'Retard', 'Hi,\n\nUnfortunately, an item on your order is currently out of stock. This may cause a slight delay in delivery.\nPlease accept our apologies and rest assured that we are working hard to rectify this.\n\nBest regards,'),
(1, 7, 'Retard', 'Kære kunde\n\nDesværre er en af de varer, du har bestilt, udsolgt i øjeblikket. Dette kan medføre en mindre forsinkelse i leveringen. Vi beklager meget og forsikrer dig om, at vi arbejder på at løse problemet.\n\nMed venlig hilsen'),
(1, 8, 'Retard', 'Dessverre er en eller flere av varene du har bestilt ikke på lager akkurat nå. Dette kan medføre noe forsinkelse i forhold til levering. Vi beklager dette og gjør vårt beste for å levere så raskt som mulig.'),
(1, 9, 'Retard', 'Dessverre er en eller flere av varene du har bestilt ikke på lager akkurat nå. Dette kan medføre noe forsinkelse i forhold til levering. Vi beklager dette og gjør vårt beste for å levere så raskt som mulig.'),
(1, 10, 'Retard', 'Hej,\n\nTyvärr är en produkt i din beställning nu slut i lager. Detta kan orsaka en viss fördröjning i leveransen.\nVi ber om ursäkt för detta, och du kan vara säker på att vi arbetar hårt för att rätta till detta.\n\nBästa hälsningar,'),
(1, 11, 'Retard', 'Dobrý den,\n\nbohužel, jedna položka z vaší objednávky není momentálně skladem a z tohoto důvodu může dojít k mírnému zpoždění doručení.\nPřijměte, prosím, naši omluvu a vězte, že se situaci snažíme usilovně napravit.\n\nS pozdravem,'),
(1, 12, 'Retard', 'Witaj,\n\nNiestety, artykuł na twoim zamówieniu jest obecnie niedostępny. Może to spowodować delikatne opóźnienie w dostawie.\nPrzepraszamy za powstałe utrudnienia, zapewniamy że pracujemy by to skorygować.\n\nZ poważaniem,'),
(1, 13, 'Retard', 'Sajnálatos módon egy vagy több megrendelt tétel nincs készleten. A kiszállítási idő megnövekedhet. \nElnézésedet kérjük a kellemetlenségek miatt, dolgozunk rajta, hogy minél előbb megkapd rendelésedet!'),
(1, 14, 'Retard', 'Buna,\n\nDin nefericire, un articol din comanda ta are momentan stocul epuizat. Aceasta poate cauza o mica intarziere a livrarii.\nTe rugam sa acceptati scuzele noastre si te asiguram ca muncim din rasputeri pentru a remedia acest inconvenient.\n\nToate cele bune,'),
(1, 15, 'Retard', 'Nažalost, proizvod koji ste naručili trenutno je rasprodan. To može uzrokovati neznatno kašnjenje u isporuci. Molimo prihvatite našu ispriku i budite uvjereni da ćemo naporno raditi kako bi se ispravio ovaj propust'),
(1, 16, 'Retard', 'Здравейте,\n\nЗа съжаление, продукт от вашата поръчка е изчерпан. Това може да причини леко забавяне в доставката.\nМоля, приемете нашите извинения и бъдете сигурни, че правим всичко, за да поправим това.\n\nС уважение,');
